  \"2013-03-28T01:14:52.094991\",\n\t\"name\": \"state-park-trails\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is a collection of ArcView
  shapefiles (by park) of trails within statutory boundaries of individual MN State
  Parks, State Recreation Areas and State Waysides managed by the Division of Parks
  and Recreation. The data contains the BREM Program Project code, Unit name, Trail
  name, Trail use, how the trail information was collected and relative accuracy,
  the date the information was collected, who owns the trail, who administers it,
  minimum width, surface type, if it is interpreted, if it is handicap accessible,
  type of G.P.S. receiver used for collection, maximum PDOP, trail segment length
  in meters, feet, kilometers and miles. This data set is not complete for all park
  units, but is a work in progress.\",\n\t\"license_title\": null,\n\t\"extras\":
